import React from "react";
import { Route, Switch} from 'react-router';
import "./C.css";
import Service from "../service/Service";
import History from "./htmls/History";

class Html extends React.Component{
    constructor(props){
        super(props)
        this.state={
            htmls:[]
        }
    }
    componentDidMount(){
        Service.getHtml().then((response) => {
            this.setState({htmls:response.data})

        });
    }
    // componentDidMount(){
    //     Service.getHome().then((response) =>{
    //         this.setState({homes:response.data})
    //     });
    // }
    itemclick(pop){

        console.log(pop);
    }
    render(){
        return(
            <div>
                <div class="feed1">
                <h3>Html Tutorials</h3>

                    {                        
                        this.state.htmls.map(
                        html =>
                        <ul key={html.id}>                            
                            <Link onClick={this.itemclick(this.id)}><li>{html.name}</li></Link>
                        </ul>
                        )
                    }
                </div>
                <div>
                    <div class="content12">
                        <div>
                            <Switch>
                                <Route exact path="/html/history" Component={History} />
                            </Switch>                                               
                        </div>
                    </div>
                </div>
            </div>
        )
    }
}
export default Html;
